 import { useState } from "react";

  function State(){
      const [value,setValue]=useState("")
      const [email,setEmail]=useState("")
      const [pswd,setPswd]=useState("")
      const [cpswd,setCpswd]=useState("")
      const Value=(e)=>{
          setValue(e.target.value)
      }
      const Email=(e)=>{
          setEmail(e.target.value)
      }
      const Pswd=(e)=>{
          setPswd(e.target.value)
      } 
      const Cpswd=(e)=>{
          setCpswd(e.target.value)
      }
      const Submit=()=>{
          if(value.length<=5){
              alert("Name must be >7 characters")
          }
          else if(pswd != cpswd){
              alert("password does not match..!")
          }
          else{
              alert("Succes")
          }
      }
      return(
          <div style={{width:"300px", textAlign:"center", marginLeft:"560px", marginTop:"200px" ,color:blue }}> <fieldset>
             <form onSubmit={Submit}>
              <input value={value} type="text" placeholder="Enter Full Name" onChange={Value} required/> <br/><br/>
              <input value={email} type="email" placeholder="enter email" required onChange={Email}/><br/><br/>
              <input value={pswd} type="password" placeholder="password" required onChange={Pswd}/><br/><br/>
              <input value={cpswd} type="password" placeholder="confirm password" required onChange={Cpswd}/><br/><br/>
              <input type="submit"/>
             </form>
             </fieldset>
          </div>
      )
  }


export default State;







